 import youtube from '../../src/img/icon-link/youtube.png'
  import tokped from '../../src/img/icon-link/tokped.png'
  import spotify from '../../src/img/icon-link/spotify.png'
import { Popup } from "./Popup";
import { PopupComingSoon } from "./PopupComingsoon";

export function January() {
  const [activePopupId, setActivePopupId] = useState(null);

  // Data popup array
  const popupDataArray = [
    {
      id: 1,
      title: "What's new in January 2025",
      src: "https://open.spotify.com/playlist/2yU2fJR5X05fzWArc18JBn?si=RIeaDx6vQwiQJ2Hi6xPz7w&pi=a-mZZcvveFSJ6n",
      content: "Sound for The People January : RUB WHILE YOU CAN",
      genre: "Music",
      icon: spotify,
    },
    {
      id: 2,
      title: "What's new in February 2025",
      src: null, // Tidak ada URL untuk Februari, menampilkan `PopupComingSoon`
      content: null,
      genre: "Movies",
      icon: null,
    },
  ];

  const handleOpenPopup = (id) => {
    setActivePopupId(id);
    document.body.classList.add("overflow-hidden");
  };

  const handleClosePopup = () => {
    setActivePopupId(null);
    document.body.classList.remove("overflow-hidden");
  };

  return (
    <div>
      {/* Menampilkan gambar atau tombol untuk setiap popup */}
      <div className={activePopupId ? "main-content blur" : "main-content"}>
        {popupDataArray.map((data) => (
          <Figure
            key={data.id}
            className="Figure"
            onClick={() => handleOpenPopup(data.id)}
          >
            <Figure.Image alt={data.title} src={january} />
          </Figure>
        ))}
      </div>

      {/* Render popup yang sesuai */}
      {popupDataArray.map((data) => {
        const isDataComplete = data.title && data.src && data.content && data.genre;

        return (
          data.id === activePopupId && (
            isDataComplete ? (
              <Popup
                key={data.id}
                isOpen={true}
                onClose={handleClosePopup}
                title={data.title}
                src={data.src}
                content={data.content}
                genre={data.genre}
                icon={data.icon}
              />
            ) : (
              <PopupComingSoon
                key={data.id}
                isOpen={true}
                onClose={handleClosePopup}
                title={data.title}
                message="Content is coming soon!"
              />
            )
          )
        );
      })}
    </div>
  );
}

